INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "キャル", "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 106001, -363.0, 7, 0.0, 1, 7001, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "コッコロ", "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 105901, -363.0, 7, 0.0, 1, 7002, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "ペコリーヌ", "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 105801, -363.0, 7, 0.0, 1, 7003, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "ペコリーヌ", "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 105801, -363.0, 10, 0.0, 1, 10001, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "キャル", "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 106001, -363.0, 10, 0.0, 1, 10002, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "コッコロ", "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 105901, -363.0, 10, 0.0, 1, 10003, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "シェフィ", "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 106401, -363.0, 10, 0.0, 1, 10004, 0.0, 1, 2104010, "2030/12/17 14:59:59", 2, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "ペコリーヌ", "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 105801, -416.5, 12, 0.0, 1, 12001, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "キャル", "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 106001, -363.0, 13, 0.0, 1, 13001, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "コッコロ", "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 105901, -363.0, 13, 0.0, 1, 13002, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "シェフィ", "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 106401, -363.0, 13, 0.0, 1, 13003, 0.0, 1, 2104010, "2030/12/17 14:59:59", 2, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "ペコリーヌ", "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 105801, -363.0, 13, 0.0, 1, 13004, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "コッコロ", "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 105901, -363.0, 14, 0.0, 1, 14001, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "シェフィ", "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 106401, -363.0, 14, 0.0, 1, 14002, 0.0, 1, 2104010, "2030/12/17 14:59:59", 2, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "ペコリーヌ", "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 105801, -363.0, 14, 0.0, 1, 14003, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "キャル", "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 106001, -363.0, 14, 0.0, 1, 14004, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "コッコロ", "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 105901, -470.0, 15, 0.0, 1, 15001, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "シェフィ", "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 106401, -363.0, 16, 0.0, 1, 16001, 0.0, 1, 2104010, "2030/12/17 14:59:59", 2, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "ペコリーヌ", "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 105801, -363.0, 16, 0.0, 1, 16002, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "キャル", "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 106001, -363.0, 16, 0.0, 1, 16003, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "コッコロ", "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 105901, -363.0, 16, 0.0, 1, 16004, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "コッコロ", " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 105901, -363.0, 17, 0.0, 1, 17002, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "キャル", "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 106001, -363.0, 25, 0.0, 1, 17004, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "コッコロ", "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 105901, -363.0, 25, 0.0, 1, 17005, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "シェフィ", "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 106401, -363.0, 25, 0.0, 1, 17006, 0.0, 1, 2104010, "2030/12/17 14:59:59", 2, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "ペコリーヌ", "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 105801, -363.0, 25, 0.0, 1, 17007, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "カリン", "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 190801, -363.0, 18, 0.0, 1, 18001, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "カリン", "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 190801, -363.0, 18, 0.0, 1, 18002, 0.0, 2, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "カリン", "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 190801, -470.0, 19, 0.0, 1, 19001, 0.0, 3, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "カリン", "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 190801, -470.0, 19, 0.0, 1, 19002, 0.0, 4, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "カリン", "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 190801, -470.0, 20, 0.0, 1, 20001, 0.0, 5, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "カリン", "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 190801, -470.0, 20, 0.0, 1, 20002, 0.0, 6, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "キャル", "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 106001, -363.0, 21, 0.0, 1, 21001, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "コッコロ", "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 105901, -363.0, 21, 0.0, 1, 21002, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "シェフィ", "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 106401, -363.0, 21, 0.0, 1, 21003, 0.0, 1, 2104010, "2030/12/17 14:59:59", 2, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "ペコリーヌ", "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 105801, -363.0, 21, 0.0, 1, 21004, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "カリン", "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 190801, -430.0, 22, 0.0, 1, 22001, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "カリン", "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 190801, -430.0, 22, 0.0, 1, 22002, 0.0, 2, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "カリン", "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 190801, -430.0, 23, 0.0, 1, 23001, 0.0, 3, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "カリン", "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 190801, -430.0, 23, 0.0, 1, 23002, 0.0, 4, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10011, "エリコ（バレンタイン）", "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 109001, -385.0, 24, 4.08, 2, 24001, 8.0, 1, 0, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10011, "エリコ（バレンタイン）", "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 109001, -385.0, 24, 5.0, 2, 24002, 8.0, 2, 0, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10011, "エリコ（バレンタイン）", "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 109001, -385.0, 24, 10.11, 2, 24003, 8.0, 3, 0, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10011, "エリコ（バレンタイン）", "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 109001, -385.0, 24, 4.0, 2, 24004, 8.0, 4, 0, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10011, "エリコ（バレンタイン）", "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 109001, -385.0, 24, 6.0, 2, 24005, 8.0, 5, 0, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10011, "エリコ（バレンタイン）", "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 109002, 0.0, 24, 0.0, 1, 24006, 0.0, 6, 0, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10011, "エリコ（バレンタイン）", "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 109002, 0.0, 24, 0.0, 1, 24007, 0.0, 7, 0, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10011, "エリコ（バレンタイン）", "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 109002, 0.0, 24, 0.0, 1, 24008, 0.0, 8, 0, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10011, "エリコ（バレンタイン）", "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 109002, 0.0, 24, 0.0, 1, 24009, 0.0, 9, 0, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10011, "エリコ（バレンタイン）", "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 109002, 0.0, 24, 0.0, 1, 24010, 0.0, 10, 0, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10011, "シズル（バレンタイン）", "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 109101, -385.0, 24, 2.12, 2, 24011, 8.0, 1, 0, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10011, "シズル（バレンタイン）", "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 109101, -385.0, 24, 4.19, 2, 24012, 8.0, 2, 0, "2030/12/17 14:59:59", 5, "2019/01/31 12:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10011, "シズル（バレンタイン）", "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 109101, -385.0, 24, 2.3, 4, 24013, 8.0, 3, 0, "2030/12/17 14:59:59", 2, "2019/01/31 12:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10011, "シズル（バレンタイン）", "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 109102, 0.0, 24, 0.0, 1, 24014, 0.0, 4, 0, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10011, "シズル（バレンタイン）", "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 109101, -385.0, 24, 5.23, 2, 24015, 8.0, 5, 0, "2030/12/17 14:59:59", 5, "2019/01/31 12:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10011, "シズル（バレンタイン）", "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 109102, 0.0, 24, 0.0, 1, 24016, 0.0, 6, 0, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10011, "シズル（バレンタイン）", "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 109101, -385.0, 24, 5.01, 2, 24017, 8.0, 7, 0, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10011, "シズル（バレンタイン）", "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 109102, 0.0, 24, 0.0, 1, 24018, 0.0, 8, 0, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10011, "シズル（バレンタイン）", "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 109102, 0.0, 24, 0.0, 1, 24019, 0.0, 9, 0, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (10011, "シズル（バレンタイン）", "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 109102, 0.0, 24, 0.0, 1, 24020, 0.0, 10, 0, "2030/12/17 14:59:59", 1, "2019/01/31 12:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "シェフィ", "ここから先は神聖な場所みたい\nどんなお宝が眠っているのか、\n今から探索するのが楽しみね♪", 106401, -363.0, 26, 0.0, 1, 26001, 0.0, 1, 2104010, "2030/12/17 14:59:59", 2, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "ペコリーヌ", "ここから先は神聖な場所\nみたいです！\nどんなお宝が手に入るか\n楽しみですね！", 105801, -363.0, 26, 0.0, 1, 26002, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
