INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "キャル", "ここにさらなる力を得るための\nアイテムが眠っているみたい！\nどんどん挑戦して\n強くなっちゃいましょ！", 106001, -363.0, 27, 0.0, 1, 27003, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
