INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "コッコロ", "こちらからアリーナに\n挑戦することができます。\n主さまらしい編成で\nライバルに挑みましょう。", 105901, -363.0, 43, 0.0, 1, 43002, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "キャル", "ここからアリーナに\n挑戦できるわよ！\nしっかり編成を考えて\nライバルに挑みなさい！", 106001, -363.0, 43, 0.0, 1, 43003, 0.0, 1, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
