INSERT INTO `v1_2151b91097cb296518c7845536094a9022c812d6f435cc4853b49af9a26055c4` VALUES (0, "アメス", "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 123001, -416.5, 45, 5.79, 2, 43006, 0.0, 3, 0, "2030/12/17 14:59:59", 1, "2015/12/17 15:00:00");
